import React from "react";
import data from "./Data"

const Store=()=>{
    return(
        <>
            <div className="container">
        {data.map((values)=>{
            return(
                <>
                    <div className="container">
                        <div className="d-flex">
                        <img src="https://www.freepik.com/free-photo/young-adult-enjoying-yoga-nature_30117217.htm" class="card-img-top" alt="..." />
                          <h5 className="card-title">{values.text}</h5>
            
                        </div>
                    </div>
                </>
            )
        })}
      </div>
        </>
    )
}
export default Store;
